import React from "react";

let id=1;

const Recipe= ({allRecipes})=>{
    return (
        <div>
            {
                allRecipes.map(r =>(
                    <ul key={r.id}>
                        {r.name}
                       <img src={r.image} alt="" /> 
                       {r.diets+" "}
                    </ul>
                ))
            }

        </div>
    )
}

export default Recipe;
